import React from 'react';
import LogoutButton from './LogoutButton';
import ArticlesList from './ArticlesList';

const HomePage = () => {
  return (
    <div>
      <h1>Welcome to the Home Page</h1>
      <LogoutButton />
      <ArticlesList />
    </div>
  );
};

export default HomePage;
